var maps = [
				{"mapId":1, "mapTheme":2, "mapName":"Candy Core Mine", "mapData":CandyCoreMine},
				{"mapId":2, "mapTheme":2, "mapName":"Sugar Rock", "mapData":SugarRock},
				{"mapId":3, "mapTheme":3, "mapName":"Acrospire", "mapData":Acrospire},
				{"mapId":4, "mapTheme":0, "mapName":"Blitz Beach", "mapData":BlitzBeach},
				{"mapId":5, "mapTheme":1, "mapName":"Mechanism", "mapData":Mechanism},
				{"mapId":6, "mapTheme":1, "mapName":"Machination", "mapData":Machination}
			];

function loadMapData(id){

	var mapId = id;
	var mapTheme, mapName, mapData;

	for (var i = 0; i < maps.length; i++) {
		var entry = maps[i];
		if(entry.mapId == mapId){
			mapTheme = entry.mapTheme;
			mapName = entry.mapName;
			mapData = entry.mapData;
			break;
		}
	}
	
    var json = JSON.parse(mapData);
    
    if(json.error) {
        alert(json.errormessage);
        return;
    }

    MapEditor.Model.setTheme(parseInt(mapTheme, 10));
    $("p#mapname").html(mapName);

    var oldClass = $("body").attr("class");
    $("body").removeClass(oldClass);
    $("body").addClass(MapEditor.Model.getTheme(), 300, function() {
        grid.updateImages(ctx);
        themeChanging = false;
    });

    grid.setClasses(json, ctx);
}